import React from "react";

export const Korean = () => (
    <div>
        <h2>한식</h2>
        <br></br>
        <img src="./img/rlmg/부부김밥.png" alt="이미지 준비중"></img>
    </div>
);

export const Chinese = () => (
    <div>
        <h2>중식</h2>
        <br></br>
        <img src="./img/rlmg/송림원.png" alt="이미지 준비중"></img>
    </div>
);

export const Japanese = () => (
    <div>
        <h2>일식</h2>
        <br></br>
        <img src="./img/rlmg/정돈 대학로본점.jpg" alt="이미지 준비중"></img>
    </div>
);

export const Western = () => (
    <div>
        <h2>양식</h2>
        <br></br>
        <img src="./img/rlmg/부부셰프.jpg" alt="이미지 준비중"></img>
    </div>
);

export const Dessert = () => (
    <div>
        <h2>양식</h2>
        <br></br>
        <img src="./img/rlmg/카페다오.png" alt="이미지 준비중"></img>
    </div>
);
